import axios from "axios";
import authHeader from "./auth-header";
import { API_URL } from "./constants";

const getEmployees = () => {
  return axios
    .get(API_URL + "api/employees", { headers: authHeader() })
    .then((response) => {
        console.log(response.data);

      return response.data;
    });
};

export default {
  getEmployees,
};
